    "ANWR progress report number FY83-7: Population size, productivity and distribution
    of muskoxen in the Arctic National Wildlife Refuge, Alaska Series",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:02.032234",nt"name": "anwr-progress-report-number-fy83-7-population-size-productivity-and-distribution-of-muskox",nt"isopen":
    false,nt"url": null,nt"notes": "Data on population size and productivity
    of muskoxen (Ovibos moschatus) Ln the Arctic National Wildlife Refuge were collected
    during surveys in April and October 1982. The post-calving population was estimated
    to be between 240 and 25 7 animals. In October, 38 calves were counted for a ratio
    of 0.49 calves/cow 2 years and older and 0.19 calves/animal older than calf. Complete
    sex and age composition data for all herds are needed before an accurate estimate
    of productivity can be made. Three adult mortalities were documented 1n 1982. Distribution
    and movement of muskoxen were determined by relocating radio-collared animals from
    mid-April through October. In May, 60-70 muskoxen from both the Sadlerochit area
    and the Tamayariak area calved in the hills east of Carter Creek. Other animals
    calved on the bluffs along the Tamayariak River, on a ridge between Arctic Creek
    and the Kekiktuk River and along the Niguanak River. Some females were observed
    done during the birth of their calves. In June after the peak of calving, several
    animals dispersed into areas not used later in the summer. From July through October
    muskoxen utilized riparian willow thickets along major river drainages. In mid-April
    animals were observed on wind-blown ridges above river valleys. Interchange of animals
    between the Tamayariak and Sadlerochit area was observed. Herds were not stable
    discrete units throughout the year.",nt"license_title": "License Not Specified",nt"extras":
